import React from 'react'
import ImageHelper from './helper/ImageHelper';

const Card = ({
    event
}) => {

    const CardTitle = event ? event.event_name : "A photo from pexels"
    const CardDescription = event ? event.description : "default description"

    return (
      <div className="card text-white bg-dark border border-info ">
        <div className="card-header lead">{CardTitle}</div>
        <div className="card-body">
          <div className="rounded border border-success p-2">
            <img
          src="https://www.pexels.com/photo/crop-woman-demonstrating-ripe-pomegranate-5946075/"
          style={{ maxHeight: "100%", maxWidth: "100%" }}
          className="mb-3 rounded"
          alt=""
          />
          </div>
          <p className="lead bg-success font-weight-normal text-wrap">
            {CardDescription}
          </p>
          <p className="btn btn-success rounded  btn-sm px-4">$ 5</p>
          <div className="row">
            <div className="col-12">
              <button
                onClick={() => {}}
                className="btn btn-block btn-outline-success mt-2 mb-2"
              >
                Add to Cart
              </button>
            </div>
            <div className="col-12">
              <button
                onClick={() => {}}
                className="btn btn-block btn-outline-danger mt-2 mb-2"
              >
                Remove from cart
              </button>
            </div>
          </div>
        </div>
      </div>
    );
  };

export default Card;
